private void setAnySpecialDisplayInfo() 
{
	// go see if any special displays are included with this version of tdc
	String query = new String(
			"select description, name from display where " + 
			"displaynum <= " + com.cannontech.tdc.data.Display.BEGINNING_CLIENT_DISPLAY_NUMBER);
	
	Object[][] results = DataBaseInteraction.queryResults( query, null );

	if( results.length > 0 )
	{
		for( int i = 0; i < results.length; i++)
		{
			SpecialTDCChild child = null;
			
			try
			{
				Class theClass = Class.forName( results[i][0].toString() );
				child = (SpecialTDCChild)theClass.newInstance();

				getListData().addElement("      " + child.getName() + "   Version : " + child.getVersion() );
			}
			catch( Exception exc )
			{ // no big deal, we could ignore it
				getListData().addElement("      (exception getting " + results[i][1].toString() + ")" );
				System.out.println("Unable to load the client method " + exc.getMessage() + " from the database.");
			}
			finally
			{
				if( child != null )
					child.destroy();
			}


		}

	}
	else
		getListData().addElement("      (None)");

}
